import { Chart } from "@amcharts/amcharts5";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Data from "./Data";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Data />} />
        <Route path="/chart" element={<Chart />} />

      </Routes>
    </Router>
  );
}

export default App;
